import React from 'react';
import classes from "./keyboard.module.css"


const Keyboard = () => {
    return (
        <div>
            <div className={classes.container}>
                <div className={classes.logo}>
                   Клавиатурный тренажер
                </div>

                <div className={classes.results}>
                    <div className={classes.results-title}>Результаты предыдущей строки:</div>
                    <div className={classes.indicators}>
                        <div className={classes.indicator}>
                            <div className={classes.indicator__icon}>
                                {/*<i className="fas fa-tachometer-alt"></i>*/}
                            </div>
                            <div className={classes.indicator__name}>Символов в минуту:</div>
                            <div className={classes.indicator__value} id={id.symbolsPerMinute}>0</div>
                        </div>
                    </div>
                </div>
            </div>
        </div>

    )
};

export default Keyboard;
